CREATE DEFINER=`tailor_demo_u`@`localhost` FUNCTION `fun2_get_yearid` (`fun_date` DATE) RETURNS INT(11) begin
DECLARE v_id,v_year,v_month,v_yid,v_tmp,v_fyear,v_lyear int;
DECLARE v_y varchar(11);
declare v_fdate,v_sdate date;
SELECT EXTRACT(YEAR FROM fun_date),EXTRACT(MONTH FROM fun_date) INTO v_year,v_month;
if(v_month>=4)THEN
set v_y=(SELECT CONCAT(v_year,'-',v_year+1));
select v_year,(v_year+1) into v_fyear,v_lyear;
ELSE
set v_y=(SELECT CONCAT(v_year-1,'-',v_year));
select (v_year-1),v_year into v_fyear,v_lyear;
end if;
if((SELECT COUNT(tyear) FROM year_m WHERE tyear=v_y)=0)THEN
if((select sdate from year_m where yearid=(select min(yearid) from year_m))>fun_date)then
return (-1);
else
return 0;
end if;
else
set v_year=(select yearid from year_m where tyear=v_y);
set v_tmp=(select uti_int from uti_m where uti='curyearid');
if(v_year=v_tmp)then
return v_year;
else
return (-1);
end if;
end if;
